${(() => {
  const dragonCurve = (n) => {
    let result = 'R';
    for (let i = 0; i < n; i++) {
      let temp = '';
      for (let j = result.length - 1; j >= 0; j--) {
        temp += result[j] === 'R' ? 'L' : 'R';
      }
      result = result + 'R' + temp;
    }
    return result;
  };
  const curve = dragonCurve(13);
  let x = 1200, y = 1000;
  let dir = 0;
  const step = 3;
  const path = [`M ${x} ${y}`];
  for (let i = 0; i < curve.length; i++) {
    x += Math.cos(dir) * step;
    y += Math.sin(dir) * step;
    path.push(`L ${x} ${y}`);
    dir += curve[i] === 'R' ? Math.PI / 2 : -Math.PI / 2;
  }
  return ``;
})()}


