${(() => {
  const hilbert = (n) => {
    const hilbertIndex = (i, n) => {
      let x = 0, y = 0;
      let s = 1;
      const size = Math.pow(2, n);
      while (s < size) {
        const rx = 1 & (i >> 1);
        const ry = 1 & (i ^ rx);
        if (ry === 0) {
          if (rx === 1) {
            x = s - 1 - x;
            y = s - 1 - y;
          }
          [x, y] = [y, x];
        }
        x += s * rx;
        y += s * ry;
        i >>= 2;
        s <<= 1;
      }
      return [x, y];
    };

    const size = Math.pow(2, n);
    const path = [];
    for (let i = 0; i < size * size; i++) {
      path.push(hilbertIndex(i, n));
    }
    return path;
  };

  const points = hilbert(6);
  const scale = 8;
  const offset = 600;
  const pathStr = points.map(([x, y], i) => 
    `${i === 0 ? 'M' : 'L'} ${offset + x * scale} ${offset + y * scale}`
  ).join(' ');
  return ``;
})()}


${(() => {
  const gosperCurve = (n) => {
    let axiom = 'A';
    const rules = {
      'A': 'A+B++B-A--AA-B+',
      'B': '-A+BB++B+A--A-B'
    };
    for (let i = 0; i < n; i++) {
      let next = '';
      for (let char of axiom) {
        next += rules[char] || char;
      }
      axiom = next;
    }
    return axiom;
  };

  const curve = gosperCurve(4);
  let x = 1400, y = 800;
  let angle = 0;
  const step = 4;
  const path = [`M ${x} ${y}`];

  for (let char of curve) {
    if (char === 'A' || char === 'B') {
      x += Math.cos(angle) * step;
      y += Math.sin(angle) * step;
      path.push(`L ${x} ${y}`);
    } else if (char === '+') {
      angle += Math.PI / 3;
    } else if (char === '-') {
      angle -= Math.PI / 3;
    }
  }
  return ``;
})()}


