  }));

  const voronoi = [];
  for (let x = 500; x < 1500; x += 10) {
    for (let y = 500; y < 1500; y += 10) {
      let minDist = Infinity;
      let nearestSeed = null;
      for (let seed of seeds) {
        const dist = Math.sqrt((x - seed.x) ** 2 + (y - seed.y) ** 2);
        if (dist < minDist) {
          minDist = dist;
          nearestSeed = seed;
        }
      }
      if (nearestSeed && minDist < 200) {
        voronoi.push(``);
      }
    }
  }
  return voronoi.join('');
})()}


